import React from 'react'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <input type="text" placeholder="Nome do Componente"/>
        <textarea placeholder="Descrição do componente"/>
        <button>Inserir Componente</button>
      </header>
    </div>
  );
}

export default App;
